    false,nt"url": null,nt"notes": "The shoreline operational divisions are
    organized and named according to County boundaries. Within county domains, divisions
    are boundaries guided by logical geopolitical features such as coastal physical
    characteristics and land ownership/ management issues, shoreline cleanup logistical
    considerations, and manageable sized coastline segments (generally not longer than
    about ten miles although some variation occurs.) Logistics, access, and manageability
    were driving considerations in this effort, particularly as it relates to types
    of cleanup operations required and problems likely to be present.",nt"license_title":
